import React from 'react';
import "../Asserts/Css/Pages/ImmigratetosouthAfrica.css";
import Header from '../Components/header';
import Footer from '../Components/footer';
import Navbar from '../Components/navbar';
import StudyAbroad from '../Components/StudyAbroad';
import YourNextStep from '../Components/YourNextStep';


const ImmigrateToSouthAfrica = ()=>{
    return (
          <div className='ImmigratetosouthAfricapage'>
              <Header></Header>
              <Navbar></Navbar>
              <StudyAbroad></StudyAbroad>
             <h1 className='ImmigratetosouthAfricamainhead'><a href="/visa">Visa</a>Immigrate To South Africa</h1>
<YourNextStep></YourNextStep>
           <Footer></Footer>
              </div>
    )
}

export default ImmigrateToSouthAfrica  ;
